import React from 'react'
import Header from '../Header/Header'
import About from '../About/About'
import Cities from '../Cities/Cities'
export default function Page() {
    return (
        <div className="page">
            
            <Header/>
            
            <About/>
            <Cities/>
            
            
        </div>
    )
}
